package Lettcode.PrimaryAlgorithms.LcString;

import java.util.HashMap;
import java.util.Map;

public class num04 {
    public static void main(String[] args) {
        String s = "";
        String t = "";
//        String s = "a";
//        String t = "b";
        System.out.println(solution(s,t));
    }

    private static boolean solution(String s, String t) {
        if (s.length() != t.length())
            return false;
        Map<Character,Integer> sMap = new HashMap<>();
        Map<Character,Integer> tMap = new HashMap<>();
        count(s,sMap);
        count(t,tMap);
        for (Character ch : sMap.keySet()) {
            Integer scount = sMap.get(ch);
            Integer tcount = tMap.get(ch);
            if (scount.intValue() != tcount.intValue()){
                System.out.println(ch + ":  " + scount + "  " + tcount);
                return false;
            }
        }
        return true;
    }

    private static void count(String t, Map<Character, Integer> tMap) {
        for (int i = 0; i < t.length(); i++) {
            char ch = t.charAt(i);
            if (tMap.containsKey(ch)){
                tMap.put(ch,tMap.get(ch) + 1);
            }
            else tMap.put(ch,1);
        }
    }
}
